INSERT INTO `news` VALUES ('41', null, null, null, null, null, null, 'หลักฐานประกอบการขอรับทุนการศึกษาเรียน  ', '<p>150.ยืนเอกสารเพิ่มเติมสำหรับการขอรับทุนส่งเสริมการศึกษาบุตรสมาชิก</p>\r\n<p>จากที่สหกรณ์สาธารณสุขนครพนมจำกัด  ได้ให้สมาชิกที่มีความประสงค์ขอรับทุนส่งเสริมการศึกษาบุตรสมาชิก ประจำปี  2555 และได้ปิดรับการยืนความประสงค์ในวัน &nbsp;16 กรกฏาคม 2555  จากตรวจสอบเอกสารเบื้องต้น มีสมาชิกบางท่านยืนเอกสารยังไม่ครบตามเงื่อนไข  ทางคณะกรรมการศึกษาและประชาสัมพันธ์   จึงขอประชาสัมพันธ์ให้ส่งเอกสารเพิ่มเติม สามารถตรวจความถูกต้องได้ที่ <a href=\"http://www.coop-nkp.com/2012/index_scho.php\">www.coop-nkp.com/2012/index_scho.php</a> ตั้งแต่วันที่ถึง 8 สิงหาคม 2555 ถ้าครบกำหนดแล้วถือเป็นการสละสิทธิ์ หรือพิจารณาในปีถัดไป&nbsp;</p>\r\n<p>เรียน พี่นิติเวช</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ผมเรียนถามหน่อยครับ วันแรกที่สหกรณ์ฯ แจ้งให้สมาชิกขอรับทุนการศึกษาให้บุตร หน้าเว็บประกาศ ณ 17-05-2012 สิ้นสุด 29 มิถุนายน 55 แต่ได้มีการขยายเวลาเพิ่มถึง 16 กค.55 นั้น ใบสมัครที่สหกรณ์ฯให้สมาชิกกรอกนั้น&nbsp;2. หลักฐานประกอบการพิจารณา ระบุไว้ว่า</p>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; หนังสือรับรองจากสถานศึกษา ( รับรองว่าบุตรผู้ขอรับทุนฯ กาลังศึกษาอยู่ในสถาบันนั้นจริง)</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;หรือสาเนาใบเสร็จชาระค่าลงทะเบียนภาคการศึกษาล่าสุดที่เป็นปัจจุบัน</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  สาเนาสูติบัตรหรือสาเนาบัตรประจาตัวประชาชนของบุตรผู้ขอรับทุน</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;  สาเนาทะเบียนบ้านของบุตรผู้ขอรับทุน</div>\r\n<div>ในมุมมองของผม คำว่า หรือ หมายถึง อย่างใดอย่างหนึ่ง &nbsp;ตามประกาศใหม่ข้างบน(ลำดับ 150) ได้ระบุให้ สมาชิกที่มีรายชื่อ ส่งหลักฐานเพิ่ม คือ ใบเสร็จค่าเทอม,บัตรประจำตัวประชาชนเด็ก ภายใน 8 สค 55 ถึง 8 สิงหาคม 2555 ถ้าครบกำหนดแล้วถือเป็นการสละสิทธิ์ หรือพิจารณาในปีถัดไป นั้น ผมขอเรียนถามพี่หน่อยครับว่า</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1.นโยบายเรียนฟรี 12 ปี ของรัฐบาล ช่วง ป.1 - ม.6 ซึ่งเด็กไม่ต้องเสียเงินค่าเทอมใด ๆ ในกรณีปกติ นอกจากการเีรียนพิเศษเพิ่มเติมอื่น ๆ ซึ่งผลดังกล่าว ทำให้สมาชิกที่มีบุตรในช่วง,ชั้นดังกล่าว ไม่มีใบเสร็จค่าเทอมที่จะนำไปประกอบการขอรับทุน &nbsp;สมควรตัดสิทธิหรือไม่ประการใด</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2.บัตรประจำตัวประชาชนเด็ก ถึงแม้จะเป็นกฏหมาย แต่ก็มีการขยายระยะเวลาในการจัดทำไป ทำให้เด็กบางคน ยังไม่ได้จัดทำบัตรฯ จึงไม่สามารถส่งสำเนาบัตรฯให้สหกรณ์ได้ตามกำหนด เพียงสูติบัตร ไม่เพียงพอต่อการยืนยันตัวบุคคลหรือครับ</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3. หากคำว่า หรือ ในใบสมัคร หมายถึงเอกสารทุกอย่างที่ระบุ ต่อไม่ขอให้สหกรณ์ฯ คำนี้ ออก และให้ใช้คำว่า และ แทน</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 4.ทุนที่สหกรณ์ฯ ระบุจะให้ ขอเรียนถามหน่อยครับ ว่าแต่ละระดับ มีทุนจำนวนกี่ทุน มีเกณฑ์พิจารณาอย่างไร หรือสุดท้ายเอาจำนวนคนที่ขอรับหารด้วยงบประมาณที่จัดสรรไว้เหมือนที่ผ่านมา</div>\r\n<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 5. สหกรณ์ฯ ควรกำหนดหลักฐานประกอบต่าง ๆ ให้ขัดเจนตั้งแต่เริ่มแรกที่จะแจ้งให้สมาชิกทราบ เพื่อให้เป็นมาตรฐานที่เชื่อถือได้ ถ้าจะเปลี่ยนหลังจากประกาศไปแล้ว ควรมีการประชาสัมพันธ์ให้สมาชิกได้รับทราบ อย่างน้อยหนังสือแจ้งเวียนที่เป็นลายลักษณ์อักษรถึงหน่วยงานต่าง ๆ ควรมี เพิ่มเติมจากหน้าเว็บประชาสัมพันธ์ของสหกรณ์ฯ</div>\r\n<div>&nbsp;</div>\r\n<div>ขอบคุณมากล่วงหน้านะพี่ ที่จะให้ความกระจ่างแก่สมาชิก&nbsp;</div>', '2012-08-16 10:40:03', '0', '1065', null, null, null, null);
