INSERT INTO `news` VALUES ('73', null, null, null, null, null, null, 'สอบถามข็อมูล', '<p>เคยทำหนังสือยื่นของดส่งเงินต้นสามัญเริ่มเดือน กันยายน 55 ไป ทำไมยังหักเหมือนเดิม ไม่เข้าเกณฑ์การพิจารณา คณะกรรมการไม่อนุมัติหรือว่าทำแบบฟอร์มหาย เพราะยื่นไว้ประมาณปลายเดือน กรกฎาคม 55</p>\r\n<p>ขอบคุณล่วงหน้า สำหรับคำตอบ</p>\r\n<p>&nbsp;</p>', '2012-10-05 15:26:07', '0', '1130', null, null, null, null);
