INSERT INTO `news` VALUES ('98', null, null, null, null, null, null, 'งานที่มอบหมายให้ทำ', '<p>งานที่มอบให้ทำ(บอกผู้จัดการด้วยนะต้น)</p>\r\n<ol>\r\n    <li>ทำผังคณะกรรมการฯชุดที่ 29 ในเว็บ และในบอร์ดสำนักงาน</li>\r\n    <li>ทำจดหมายข่าวฉบับที่ 1 ปี 2556&nbsp;\r\n    <ol>\r\n        <li>เนื้อหา ประธานพบสมาชิก คณะกรรมการอวยพรปีใหม่ ที่ปรึกษาอวยพรปีใหม่ ผู้ตรวจสอบอวยพรปีใหม่ สหกรณ์จังหวัดอวยพรปีใหม่</li>\r\n        <li>รายชื่อคณะกรรมการชุดใหม่</li>\r\n        <li>รายการกิจการ ผลการดำเนินการ จำนวนสมาชิก สินทรัพย์ รายได้ รายจ่าย กำไร ขาดทุน ดอกเบี้ย ส่วนต่าง&nbsp;</li>\r\n        <li>สวัสดิการที่เพิ่มขึ้นใหม่ในปี 56</li>\r\n        <li>สาระสำคัญของระเบียบที่แก้ไข และเพิ่มเติมใหม่</li>\r\n        <li>สรุปประเด็นสำคัญในการประชุมใหญ่สามัญประจำปี</li>\r\n    </ol>\r\n    </li>\r\n</ol>', '2012-12-22 13:59:29', '0', '35', null, null, null, null);
