INSERT INTO `news` VALUES ('100', null, null, null, null, null, null, 'งานในเว็บครั้งที่ 2', '<p class=\"MsoNormal\" style=\"text-align: left;\">1.ให้เรียงลำดับภาพตามนี้</p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\">2.ให้ทำจดหมายข่าว ขอเนื้อหาจากประธานศึกษา (เชษฐา) และรองประธาน ประธานเงินกู้</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span lang=\"TH\" style=\"font-size:20.0pt;mso-ansi-font-size:16.0pt;line-height:115%;font-family:\r\n&quot;TH SarabunPSK&quot;,&quot;sans-serif&quot;\">คณะกรรมการสหกรณ์ออมทรัพย์สาธารณสุขนครพนม จำกัด ชุดที่ ๒๙</span></b><b><span style=\"font-size:16.0pt;mso-bidi-font-size:20.0pt;\r\nline-height:115%;font-family:&quot;TH SarabunPSK&quot;,&quot;sans-serif&quot;\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l2 level1 lfo1\"><!--[if !supportLists]--><span lang=\"TH\" style=\"font-size:16.0pt;mso-ansi-font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;TH SarabunPSK&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;TH SarabunPSK&quot;\">๑.<span style=\"font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"TH\" style=\"font-size:16.0pt;\r\nmso-ansi-font-size:12.0pt;line-height:115%;font-family:&quot;TH SarabunPSK&quot;,&quot;sans-serif&quot;\">นายนิติเวช&nbsp; &nbsp;&nbsp;&nbsp;&nbsp; นนท์จันทร์&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ประธานกรรมการ</span><span style=\"font-size:12.0pt;mso-bidi-font-size:16.0pt;line-height:115%;font-family:\r\n&quot;TH SarabunPSK&quot;,&quot;sans-serif&quot;\"><o:p></o:p></span></p>\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-18.0pt;mso-list:l2 level1 lfo1\"><!--[if !supportLists]--><span lang=\"TH\" style=\"font-size:16.0pt;mso-ansi-font-size:12.0pt;line-height:115%;\r\nfont-family:&quot;TH SarabunPSK&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;TH SarabunPSK&quot;\">๒.<