INSERT INTO `news` VALUES ('184', null, null, null, null, null, null, 'การค้ำประกัน\r\nตรวจสอบข้อมูลสมาชิก เมื่อ ๑๔ พย.๕๗ ในเมนูค้ำประกันสมาชิก พบว่า เป็นผู้ค้ำประกัน นางจงกล ธมิกานนท์ ตามสัญญากู้เลขที่ พป5500327  ซึ่งข้อเท็จจริง ไม่เคยค้ำประกันเงินกู้บุคคลดังกล่าวเลย ขอให้ตรวจสอบให้โดยด่วนครับ\r\nเจษฎาจักรี', '0', '2014-11-20 07:31:16', '0', '1734', null, null, null, null);
